package com.example.carros;

import static org.junit.Assert.assertEquals;

import java.net.URI;

import org.junit.Test;
import org.junit.runner.RunWith;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.test.context.SpringBootTest;
import org.springframework.boot.test.web.client.TestRestTemplate;
import org.springframework.core.io.Resource;
import org.springframework.http.HttpStatus;
import org.springframework.http.ResponseEntity;
import org.springframework.test.context.junit4.SpringRunner;

import com.example.carros.upload.UploadInput;
import com.example.carros.upload.UploadService;

@RunWith(SpringRunner.class)
@SpringBootTest
public class UploadServiceTest {
	
	@Autowired
	private UploadService service;
	
	private UploadInput getUploadInputImage() {
		UploadInput input = new UploadInput();
		input.setFileName("teste.jpeg");
		input.setMimeType("image/jpeg");
		// Base64 de imagem
		input.setBase64("");
		return input;
	}
	
	private UploadInput getUploadInputFile() {
		UploadInput input = new UploadInput();
		input.setFileName("teste.txt");
		input.setMimeType("text/plain");
		// Base64 do arquivo txt contendo: Este Ã© um arquivo convertido em Base64
		input.setBase64("RXN0ZSDDqSB1bSBhcnF1aXZvIGNvbnZlcnRpZG8gZW0gQmFzZTY0Cg==");
		return input;
	}
	
	@Test
	public void testStorage() {
		UploadInput uploadInput = getUploadInputImage();
		service.uploadFile(uploadInput);
		
		Resource resource = service.getFileAsResource(uploadInput.getFileName());
		assertEquals(resource.getFilename(), uploadInput.getFileName());
	}
}
